import React, { Component } from 'react';
import { Route } from  'react-router-dom'

class Land extends Component {
    render() {
        return (
            <div class="container">
            <div><a href="/reg">I'm just curious what other people have written! </a></div>
            <div>I want to create something by myself</div>
            </div>
            )
    }
}

export default Land;
